package imageinpdffinal;


import org.apache.commons.codec.binary.Base64;
import com.itextpdf.text.Rectangle;
import com.itextpdf.text.pdf.PdfReader;
import org.apache.pdfbox.text.PDFTextStripper;
import org.apache.pdfbox.text.TextPosition;
import java.util.ArrayList;
import java.util.List;
import org.apache.pdfbox.pdmodel.PDDocument; 
import org.apache.pdfbox.pdmodel.PDPage; 
import org.apache.pdfbox.pdmodel.graphics.image.PDImageXObject; 
import org.apache.pdfbox.pdmodel.PDPageContentStream; 
import java.io.*;

/**
 *
 * @author Paul
 */
public class ImageInPDFFinal extends PDFTextStripper {

    
      public int XCoordinate;
      public int YCoordinate;
      
      public static final String DEST = "/home/paul/Documents/Anamneso/Backend Code/Beispiele/PDFWithSignature.pdf";
    
     public static String Base64Image ="\n" +
"\n" +
"\n" +
"\n" +
"\n" +
"";
    
  public static String Base64PDF ="";
  
  
  public ImageInPDFFinal() throws IOException {
    }
    
    
    /**
     * @param args the command line arguments
     */
    public static void main(String[] args) throws IOException {
        
            byte[] decodedBase64PDF={};
            decodedBase64PDF = Base64.decodeBase64(Base64PDF.getBytes());   
        
        PDDocument document= null;
        
        try {
            
            document = PDDocument.load(decodedBase64PDF);
            PDFTextStripper stripper = new ImageInPDFFinal();
            stripper.setSortByPosition( true );
            stripper.setStartPage( 0 );
            stripper.setEndPage( document.getNumberOfPages() );
            Writer dummy = new OutputStreamWriter(new ByteArrayOutputStream());
            stripper.writeText(document, dummy);
        }
        finally {
            if( document != null ) {
                document.close();
            }
        }
    }

    protected void writeString(String string, List<TextPosition> textPositions) throws IOException {
   
        ArrayList<String> arrLetter = new ArrayList<String>();
        ArrayList<Integer> arrX = new ArrayList<Integer>();
        ArrayList<Integer> arrY = new ArrayList<Integer>();
         
        String Letter ="";

        for (TextPosition text : textPositions) {
   
         Letter = String.valueOf(text);
         arrLetter.add(Letter);
 
        int X = Math.round(text.getXDirAdj());
        int Y = Math.round(text.getYDirAdj());
        arrX.add(X);
        arrY.add(Y);
   
        }
       
        arrLetter.add(" ");
           for (int Index=0; Index<arrLetter.size(); Index++) 
             {  
                  if(arrLetter.get(Index).equals("U"))
                  {
                   if(arrLetter.get(Index+1).equals("n"))
                   {
                        if(arrLetter.get(Index+2).equals("t"))
                   {
                        if(arrLetter.get(Index+3).equals("e"))
                   {
                        if(arrLetter.get(Index+4).equals("r"))
                   {
                        if(arrLetter.get(Index+5).equals("s"))
                   {
                        if(arrLetter.get(Index+6).equals("c"))
                   {
                        if(arrLetter.get(Index+7).equals("h"))
                   {
                        if(arrLetter.get(Index+8).equals("r"))
                   {
                        if(arrLetter.get(Index+9).equals("i"))
                   {
                        if(arrLetter.get(Index+10).equals("f"))
                   {
                        if(arrLetter.get(Index+11).equals("t"))
                   {
                      System.out.println("Word detected");
                      XCoordinate =arrX.get(Index);
                      YCoordinate = arrY.get(Index);

            byte[] decodedBase64Image={};
            decodedBase64Image = Base64.decodeBase64(Base64Image.getBytes());
            
            byte[] decodedPDF={};
            decodedPDF = Base64.decodeBase64(Base64PDF.getBytes());   
         
        //Calculate Number of Pages
        PDDocument  doc = PDDocument.load(decodedPDF);
        int Pages = doc.getNumberOfPages();
        PDPage page = doc.getPage(Pages-1); 
        
        
        //Check height and width of PDF
        PdfReader reader = new PdfReader(decodedPDF);
        Rectangle mediabox = reader.getPageSize(Pages);
        String CoordiantesPDF = String.valueOf(mediabox);
        int PDFheight = Integer.parseInt(CoordiantesPDF.substring(17,20));
        YCoordinate = PDFheight - YCoordinate -30;
                
        
        PDImageXObject pdfimg = PDImageXObject.createFromByteArray(doc, decodedBase64Image, "png"); 
        PDPageContentStream image = new PDPageContentStream(doc, page, true, true, true); 
           
        //X Coordiantes , Y Coordinates max height 842px docx; 794px with odt
        image.drawImage(pdfimg, XCoordinate, YCoordinate, 200, 40);
        System.out.println("Image Inserted at:[X: "+XCoordinate+" ; Y: "+YCoordinate+"]"); 

        image.close(); 
        doc.save(DEST); 

        doc.close();
                      
                   }  
                   } 
                   }
                   }
                   }  
                   }
                   }
                   }     
                   }
                   }
                   }
                   } 
            }     
    }
    
}
